import React from 'react';
import './LoginPage.css';
import { IonPage, IonHeader, IonContent, IonTitle, IonButton, IonRouterLink } from "@ionic/react"
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

function LoginForm() {
    var login_form = (

        <IonPage>
            <IonHeader>
                <IonTitle>letterBox</IonTitle></IonHeader>
            <IonContent>
                <form>
                    <input className="input-style" placeholder="Name" type="text" /><br></br>
                    <input className="input-style" placeholder="Phone" type="tel" maxLength="10" />
                    <input className="input-style" placeholder="Passcode" type="password" />
                </form>
                <Router><Link >

                    <IonButton to="/tab2">Login</IonButton>
                </Link>
                </Router>
            </IonContent>

        </IonPage>
    );

    return login_form;
};

export default LoginForm;
